import React , {Component} from "react"
import {getProducts} from "../FakeData/Products"


class Card extends Component{
    
    render(){
        const products = getProducts()
        console.log(products)
        return(
            <React.Fragment>
            {products.map(product=>
                <div key={product._id} className="card mb-4 shadow-sm">
            <div className="card-header">
              <h4 className="my-0 font-weight-normal">{product.Name}</h4>
            </div>
            <div className="card-body">
              <h1 className="card-title pricing-card-title">{product.Price} <small className="text-muted">U$D</small></h1>
              <ul className="list-unstyled mt-0 mb-0">
                <li>{product.Description}</li>
                <li>Selling by: {product.SellingBy}</li>
              </ul>
              <button type="button" onClick={()=>onDelete({product})}className="btn btn-lg btn-block btn-outline-primary">Delete</button>
            </div>
          </div>
                )}
            </React.Fragment>
        )
    }
}

export default Card;
